import React from 'react';
import { Container } from './styled';

const Page = () => {
    return (
        <Container>
            <div className='lado-esquerdo'>
                lado A
            </div>
            <div className='lado-direito'>
                lado B
            </div>
        </Container>
    );
}

export default Page;
